import React, { useState } from "react";
import MainPage from "./小omponents/mainPage/MainPage";
import RegistrationPage from "./小omponents/registrationPage/RegistrationPage";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            isLoggedIn ? (
              <RegistrationPage />
            ) : (
              <MainPage onLogin={handleLogin} />
            )
          }
        />
        <Route path="/PDFUploadPage" element={<PDFUploadPage />} />
      </Routes>
    </Router>
  );
}

export default App;
